import Slidebar from "../../Components/Slidebar";
import { Link } from 'react-router-dom';

const Listing = () => {
  return (
    <>
     <section className="product_Listing_Page">
      <div className="container">
         <div className="productListing d-flex">
           <Slidebar />
           <div className="content_right">
           <Link to="#">
  <img 
    src="https://img.freepik.com/free-vector/flat-world-chocolate-day-sale-horizontal-banner-template_23-2149457339.jpg?t=st=1742399239~exp=1742402839~hmac=bbe5d1e82ea4d3ccbefb2870a2393c9d399cce2f4921da009a88581095c3b1a4&w=2000" 
    className="w-100 mt-4 ml-0" 
    alt="Product"
  />
</Link>
           </div>
         </div>
      </div>
     </section>
    </>
  );
}
export default Listing;
